import { useContext } from 'react'
import {productContext} from '../../contexts/products'
import { ActionTypes } from '../../pages/Home/Home'
import {List} from './style'


export default function Nav() {

    const {products,setProductsFetched} = useContext(productContext)

    return (
        <>
         <List>
            <li onClick={()=> setProductsFetched({type:ActionTypes.ALL,payload:products})}>All</li>
            <li onClick={()=> setProductsFetched({type:ActionTypes.CARS,payload:products})}>Car</li>
            <li onCli>Bike</li>
         </List>
        </>
    )

}
